import React, { useState } from 'react';

function App() {
  const [counter, setCounter] = useState(0);
  const increaseCounter = () => {
    setCounter(counter++);
  };
  return (
    <>
      <h1>Current: {counter}</h1>
      <button onClick={increaseCounter}>Increase</button>
    </>
  );
}

export default App;
